import React from 'react';
import './log.css';

const Login = () => {
    return (
        
        <form>
        <div class="row row-cols-1 row-cols-md-2 g-4">
        <div className='from' class="col shadow p-3 mb-5 bg-body-tertiary rounded" >
        <div class="mb-3" >
          <label for="usernam" class="form-label">User Name</label>
          <input type="username" class="form-control" id="exampleInputusername" aria-describedby="username" />
        </div>
        <div class="mb-3">
          <label for="password" class="form-label">Password</label>
          <input type="password" class="form-control" id="exampleInputPassword1" />
        </div>
        <button type="submit" class="btn btn-secondary">Login</button>
        </div>
        </div>
      </form>
    );
};

export default Login;
